import React, { Component } from "react";
import { Grid, Image, Icon, Button, Divider } from "semantic-ui-react";
import AOS from "aos";
import "aos/dist/aos.css";

export default class Tools extends Component {
  componentDidMount() {
    AOS.init();
  }

  render() {
    return (
      <div id="skills" data-aos="fade">
        <Grid columns="five" divided>
          <Grid.Row>
            <Grid.Column>
              <div class="skill">
                <i class="fab fa-html5"></i>
                <p>HTML5</p>
              </div>
            </Grid.Column>
            <Grid.Column></Grid.Column>
            <Grid.Column></Grid.Column>
            <Grid.Column></Grid.Column>
          </Grid.Row>
          <Grid.Row>
            <Grid.Column></Grid.Column>
            <Grid.Column></Grid.Column>
            <Grid.Column></Grid.Column>
            <Grid.Column></Grid.Column>
          </Grid.Row>
          <Grid.Row>
            <Grid.Column></Grid.Column>
            <Grid.Column></Grid.Column>
            <Grid.Column></Grid.Column>
            <Grid.Column></Grid.Column>
          </Grid.Row>
          <Grid.Row>
            <Grid.Column></Grid.Column>
            <Grid.Column></Grid.Column>
            <Grid.Column></Grid.Column>
            <Grid.Column></Grid.Column>
          </Grid.Row>
        </Grid>
      </div>
    );
  }
}
